  public debug_next_token (): Symbol {
    const s = this.next_token();
    console.log('line:' + (this.yyline + 1) + ' col:' + (this.yycolumn + 1) + ' --' + this.yytext() + '--' + this.getTokenName(s.sym) + '--');
    return s;
  }
  
  private symbol (type, value?) {
    if (value) {
      return new Symbol(type, this.yyline, this.yycolumn, value);
    } else {
      return new Symbol(type, this.yyline, this.yycolumn);
    }
    
  }
  
